import React from 'react'

function Navbar() {
    return (
        <div>
            <nav class="navbar navbar-expand-lg">
                <a class="navbar-brand" href="#">Casa Izvorul Raraului</a>
            </nav>
        </div>
    )
}

export default Navbar
